import React from 'react';

const Home = () => {
    return <>
        <section className={'home'} id='home'>
            <div className='home_container'>
                <div className='home_container_photo'></div>
                <div className='home_container_introduction'></div>
                <p className={'home_description'}>Hi </p>
                <p className={'home_name'}>Grzegorz Kaczor</p>
                <p className={'home_description'}>Web developer</p>
            </div>
        </section>
    </>
};

export default Home;
